@prefix owl:    <http://www.w3.org/2002/07/owl#> .
@prefix soma:   <http://www.ease-crc.org/ont/SOMA.owl#> .
@prefix dul:    <http://www.ontologydesignpatterns.org/ont/dul/DUL.owl#> .
@prefix geo:    <http://www.opengis.net/ont/geosparql#> .
@prefix xsd:    <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf:    <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs:   <http://www.w3.org/2000/01/rdf-schema#> .
@prefix psr:    <https://w3id.org/psr-task#> .

:instructionRestoreKitchen a psr:Instruction ;
    psr:hasNaturalLanguage "Restore the kitchen to an organized state by identifying all misplaced items and returning them to their standard storage locations based on their type and function. Prioritize actions according to logical task order, and perform each step atomically." ;
    psr:hasWorkflow :workflowRestoreKitchen .

:workflowRestoreKitchen a psr:Workflow ;
    psr:hasAction 
        :action1OpenCabinet, 
        :action2PickUpCereal1, :action3PutCereal1, 
        :action4PickUpCereal2, :action5PutCereal2, 
        :action6PickUpJello, :action7PutJello, 
        :action8PickUpSalt, :action9PutSalt, 
        :action10PickUpJam, :action11PutJam, 
        :action12PickUpPot, :action13PutPot,
        :action14PickUpMug, :action15PutMug,
        :action16PickUpPlates, :action17PutPlates,
        :action18PickUpShortbread, :action19PutShortbread,
        :action20PickUpGlass, :action21PutGlass,
        :action22PickUpPitcher, :action23PutPitcher,
        :action24CloseCabinet,
        :action25OpenFridge,
        :action26PickUpWater, :action27PutWater,
        :action28CloseFridge .

:robot a dul:Agent .

:cabinet a psr:Furniture .
:fridge a psr:Appliance .

:cereal1 a psr:Object .
:cereal2 a psr:Object .
:jelloBox a psr:Object .
:saltContainer a psr:Object .
:jamJar a psr:Object .
:potObject a psr:Object .
:mugObject a psr:Object .
:plateStack a psr:Object .
:shortbreadBox a psr:Object .
:glassObject a psr:Object .
:pitcherObject a psr:Object .
:waterBottle a psr:Object .

:action1OpenCabinet a dul:Action, soma:Opening ;
    soma:isPerformedBy :robot ;
    psr:actsOn :cabinet ;
    psr:isAffordedBy soma:Opening ;
    psr:precedes :action2PickUpCereal1 .

:action2PickUpCereal1 a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :cereal1 ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action3PutCereal1 .

:action3PutCereal1 a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :cereal1 ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action4PickUpCereal2 .

:action4PickUpCereal2 a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :cereal2 ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action5PutCereal2 .

:action5PutCereal2 a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :cereal2 ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action6PickUpJello .

:action6PickUpJello a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :jelloBox ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action7PutJello .

:action7PutJello a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :jelloBox ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action8PickUpSalt .

:action8PickUpSalt a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :saltContainer ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action9PutSalt .

:action9PutSalt a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :saltContainer ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action10PickUpJam .

:action10PickUpJam a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :jamJar ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action11PutJam .

:action11PutJam a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :jamJar ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action12PickUpPot .

:action12PickUpPot a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :potObject ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action13PutPot .

:action13PutPot a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :potObject ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action14PickUpMug .

:action14PickUpMug a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :mugObject ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action15PutMug .

:action15PutMug a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :mugObject ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action16PickUpPlates .

:action16PickUpPlates a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :plateStack ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action17PutPlates .

:action17PutPlates a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :plateStack ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action18PickUpShortbread .

:action18PickUpShortbread a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :shortbreadBox ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action19PutShortbread .

:action19PutShortbread a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :shortbreadBox ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action20PickUpGlass .

:action20PickUpGlass a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :glassObject ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action21PutGlass .

:action21PutGlass a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :glassObject ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action22PickUpPitcher .

:action22PickUpPitcher a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :pitcherObject ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action23PutPitcher .

:action23PutPitcher a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :pitcherObject ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action24CloseCabinet .

:action24CloseCabinet a dul:Action, soma:Closing ;
    soma:isPerformedBy :robot ;
    psr:actsOn :cabinet ;
    psr:isAffordedBy soma:Closing ;
    psr:precedes :action25OpenFridge .

:action25OpenFridge a dul:Action, soma:Opening ;
    soma:isPerformedBy :robot ;
    psr:actsOn :fridge ;
    psr:isAffordedBy soma:Opening ;
    psr:precedes :action26PickUpWater .

:action26PickUpWater a dul:Action, soma:PickingUp ;
    soma:isPerformedBy :robot ;
    psr:actsOn :waterBottle ;
    psr:isAffordedBy soma:PickingUp ;
    psr:precedes :action27PutWater .

:action27PutWater a dul:Action, soma:PuttingDown ;
    soma:isPerformedBy :robot ;
    psr:actsOn :waterBottle ;
    psr:isAffordedBy soma:PuttingDown ;
    psr:precedes :action28CloseFridge .

:action28CloseFridge a dul:Action, soma:Closing ;
    soma:isPerformedBy :robot ;
    psr:actsOn :fridge ;
    psr:isAffordedBy soma:Closing .
